ingredients_text_with_allergens_fr:
Sorbet citron 59,6% : eau, jus de citron à base de concentré 13,3%, sirop de glucose, sucre, épaississant : gomme xanthane, géllfiant : gomme guar, dextrose, saccharose, protéines de pois hydrolisées, arôme naturel de citron; 

Enrobage bâtonnet au citron 20,2% : eau, sucre, jus de citron à base de concentré 3,3%, sirop de glucose, antimoussant  mono- et diglycérides d’acides gras, gélifiants : gomme guar, alginate de sodium, carraghénanes ; arôme naturel de citron, colorants : caroténoïdes et curcumine.

Enrobage bâtonnet à l’orange 20,2% ; eau, jus d'orange à base de concentré  6,4%, sucre, sirop de glucose, gélifiants : gomme guar, alginate de sodium, carraghénanes ; acidifiant : acide citrique, · colorants : caroténoïdes, paprika, val curcumine ; arôme naturel d’orange.

